import React from "react";

class Documents extends React.Component{
    constructor(){
        super();
        this.state={};
    }

    render(){
        return(
            <div id="docs-container">
                <div id="title"><p>Documents</p></div>
                <div></div>
            </div>
        );
    }
}

export default Documents;
